import React from "react";
import './contato.css';
import fotoWpp from './wpz.png';
import fotoEmail from './eml.png';
import fotoInsta from './inst.png';


function Contato (){
    return(
        <div className="principaldiv">
            <div className="wpp" > <img id="wpp" src={fotoWpp} /> <h1>Whatssap</h1> <span>+55 19 1234-5678</span> </div>

            <div className="email" > <img id="email" src={fotoEmail} /> <h1>Email</h1><span>meuemail@hotmail.com</span> </div>

            <div className="insta" > <img id="insta" src={fotoInsta} /><h1>Whatssap</h1><span> @meuinstagram</span></div>
        </div>
    )
}

export default Contato
